import React from "react";

const Aladin = () => {
  React.useEffect(() => {
    const script1 = document.createElement("script1");

    script1.src = "https://code.jquery.com/jquery-1.12.1.min.js";
    script1.async = true;
    document.body.appendChild(script1);

    const script2 = document.createElement("script2");

    script2.src =
      "https://aladin.u-strasbg.fr/AladinLite/api/v2/latest/aladin.min.js";
    script2.async = true;
    document.body.appendChild(script2);

    let aladin = A.aladin("#aladin-lite-div", {
      survey: "P/DSS2/color",
      fov: 60,
    });
    aladin.setFov(1);
  }, []);

  return (
    <div id="aladin-lite-div" style={{ width: "400px", height: "400px" }} />
  );
};

export default Aladin;
